import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./Components/Home";
import Login from "./Components/Login";
import Register from "./Components/Register";
import FlightCRUD from "./Components/FlightCRUD";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/admin" element={<Home />} />
        <Route path="/admin/create" element={<FlightCRUD />} />
        <Route path="/admin/search" element={<SearchFlight />} />
        <Route path="/admin/update" element={<UpdateFlight />} />
        <Route path="/admin/delete" element={<DeleteFlight />} />
      </Routes>
    </Router>
  );
}

export default App;
